import React from 'react';


class UserInfo extends React.Component{
    render(){
        return(
            <div className="info">
                <div className="user-id"><span></span></div>
                <div className="user-name"><span></span></div>
                <div className="user-contacts"><span></span></div>
            </div>
        )
    }
}

export default UserInfo
